import { StyleSheet, Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

const Stack = createNativeStackNavigator();
 import Home from './assets/src/paginas/Home';
 import Buscacep from './assets/src/paginas/Buscacep';
 import buscaRastreio from './assets/src/paginas/BuscarRastreio';
export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Home" component={Home} />
        <Stack.Screen name="BuscaCep" component={Buscacep} />
        <Stack.Screen name="buscaRastreio" component={buscaRastreio} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
